import {PHOTOGALLERY_ROUTE, PHOTO_ROUTE, REGISTRATION_ROUTE, LOGIN_ROUTE} from "./utils/consts"
import {Auth, Photogallery, PhotoPage} from "./pages"

export const authRouters = [
    {
        path: PHOTO_ROUTE,
        Component:Auth
    },
   
]

export const publicRoutes = [
    {
        path: LOGIN_ROUTE,
        Component:Photogallery
    },
    {
        path: PHOTOGALLERY_ROUTE,
        Component:Photogallery
    },
       
    {
        path: REGISTRATION_ROUTE,
        Component:Photogallery
    }, 
    {
        path: PHOTO_ROUTE + '/:id',
        Component: PhotoPage
    }, 
]
